import React from 'react';
import {
    MDBCard,
    MDBCardBody,
    MDBCardTitle,
    MDBCardText,
    MDBBtn
} from 'mdb-react-ui-kit';

export default function Card() {
    return ( <
        MDBCard >
        <
        MDBCardBody >
        <
        MDBCardTitle > Card title < /MDBCardTitle> <MDBCardText>
        Some quick example text to build on the card title and make up the bulk of the card 's content. </MDBCardText > <
        MDBBtn > Button < /MDBBtn>  <
        /MDBCardBody >  <
        /MDBCard>

    );
}
